import React from 'react';
import CFImage from './CommuteForecast/CommuteForecast.GIF';
import './App.css';


class CommuteForecast extends React.Component {
  render(){
    return(
        <div className='Commute'>
          <h1>CommuteForecast: Is it worth it?</h1>
          <img src={CFImage} className="CommuteImage" alt="CFImage" />
        </div>
      )
}
}


export default CommuteForecast;
